import React, { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement } from 'chart.js';
import { Bar, Scatter, Line, Doughnut } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement);

const ModelingContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #1e3a8a;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const ModelSection = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 40px;
  margin-bottom: 30px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const ModelTitle = styled.h3`
  font-family: 'Merriweather', serif;
  font-size: 1.7rem;
  color: #1e3a8a;
  margin-bottom: 25px;
  display: flex;
  align-items: center;
  gap: 12px;
`;

const TabContainer = styled.div`
  display: flex;
  margin-bottom: 30px;
  border-bottom: 2px solid #e2e8f0;
  overflow-x: auto;
`;

const Tab = styled.button`
  background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'transparent'};
  color: ${props => props.active ? 'white' : '#64748b'};
  border: none;
  padding: 15px 25px;
  font-size: 1rem;
  font-weight: 600;
  cursor: pointer;
  border-radius: 8px 8px 0 0;
  transition: all 0.3s ease;
  margin-right: 5px;
  white-space: nowrap;

  &:hover {
    background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'rgba(100, 116, 139, 0.1)'};
  }
`;

const ModelResults = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr;
  gap: 30px;
  margin-bottom: 30px;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const ResultsTable = styled.div`
  background: #f8fafc;
  border-radius: 12px;
  padding: 25px;
  border: 1px solid #e2e8f0;
`;

const TableTitle = styled.h4`
  font-size: 1.2rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  font-weight: 600;
`;

const TableRow = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr 1fr 1fr 1fr;
  gap: 15px;
  padding: 12px 0;
  border-bottom: 1px solid #e2e8f0;
  font-size: 0.9rem;

  &:first-child {
    font-weight: 600;
    color: #374151;
    background: #e2e8f0;
    padding: 15px 10px;
    border-radius: 8px;
    margin-bottom: 10px;
  }

  &:last-child {
    border-bottom: none;
  }
`;

const Variable = styled.span`
  font-weight: 500;
  color: #374151;
`;

const Coefficient = styled.span`
  color: ${props => {
    if (props.significant) {
      return props.value > 1 ? '#059669' : '#dc2626';
    }
    return '#6b7280';
  }};
  font-weight: ${props => props.significant ? '600' : '400'};
`;

const PValue = styled.span`
  color: ${props => {
    if (props.value < 0.001) return '#dc2626';
    if (props.value < 0.01) return '#ea580c';
    if (props.value < 0.05) return '#ca8a04';
    return '#6b7280';
  }};
  font-weight: ${props => props.value < 0.05 ? '600' : '400'};
`;

const ModelMetrics = styled.div`
  background: white;
  border-radius: 12px;
  padding: 25px;
  border: 1px solid #e2e8f0;
`;

const MetricItem = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 12px 0;
  border-bottom: 1px solid #f3f4f6;

  &:last-child {
    border-bottom: none;
  }
`;

const MetricLabel = styled.span`
  color: #4b5563;
  font-weight: 500;
`;

const MetricValue = styled.span`
  color: #1f2937;
  font-weight: 600;
  font-size: 1.1rem;
`;

const ChartContainer = styled.div`
  margin: 30px 0;
`;

const ChartTitle = styled.h4`
  font-size: 1.3rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  text-align: center;
`;

const ModelExplanation = styled.div`
  background: ${props => {
    switch(props.type) {
      case 'info': return 'linear-gradient(135deg, #dbeafe, #bfdbfe)';
      case 'warning': return 'linear-gradient(135deg, #fef3c7, #fde68a)';
      case 'success': return 'linear-gradient(135deg, #d1fae5, #a7f3d0)';
      default: return 'linear-gradient(135deg, #f3f4f6, #e5e7eb)';
    }
  }};
  padding: 25px;
  border-radius: 15px;
  border-left: 4px solid ${props => {
    switch(props.type) {
      case 'info': return '#3b82f6';
      case 'warning': return '#f59e0b';
      case 'success': return '#10b981';
      default: return '#6b7280';
    }
  }};
  margin: 25px 0;
`;

const ExplanationTitle = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: #1f2937;
  margin-bottom: 12px;
`;

const ExplanationText = styled.p`
  font-size: 0.95rem;
  line-height: 1.6;
  color: #374151;
  margin: 0;
`;

const RegularizationPath = styled.div`
  background: white;
  border-radius: 15px;
  padding: 25px;
  margin: 20px 0;
  box-shadow: 0 5px 15px rgba(0,0,0,0.1);
`;

const DeepStatisticalModeling = () => {
  const [activeModel, setActiveModel] = useState('elastic-net');

  const elasticNetResults = [
    { variable: 'Baseline Volume (>100 patients)', coefficient: '2.34', se: '0.08', ci: '2.18-2.52', pvalue: '<0.001', significant: true, retained: true },
    { variable: 'Community Health Center', coefficient: '1.89', se: '0.12', ci: '1.67-2.14', pvalue: '<0.001', significant: true, retained: true },
    { variable: 'Rural Setting', coefficient: '0.67', se: '0.07', ci: '0.58-0.77', pvalue: '<0.001', significant: true, retained: true },
    { variable: 'Medicaid Expansion State', coefficient: '1.43', se: '0.09', ci: '1.28-1.60', pvalue: '<0.001', significant: true, retained: true },
    { variable: 'Nurse Practitioner', coefficient: '0.82', se: '0.05', ci: '0.74-0.91', pvalue: '<0.001', significant: true, retained: false },
    { variable: 'Years in Practice (>10)', coefficient: '1.25', se: '0.07', ci: '1.16-1.35', pvalue: '<0.001', significant: true, retained: true }
  ];

  const crossValidationResults = {
    labels: ['Fold 1', 'Fold 2', 'Fold 3', 'Fold 4', 'Fold 5', 'Fold 6', 'Fold 7', 'Fold 8', 'Fold 9', 'Fold 10'],
    datasets: [{
      label: 'Accuracy (%)',
      data: [76.2, 74.8, 75.9, 73.5, 76.8, 75.1, 74.3, 75.7, 76.4, 75.2],
      backgroundColor: 'rgba(59, 130, 246, 0.6)',
      borderColor: '#3b82f6',
      borderWidth: 1,
      borderRadius: 6,
    }]
  };

  const rocCurveData = {
    datasets: [{
      label: 'ROC Curve (AUC = 0.83)',
      data: [
        {x: 0, y: 0}, {x: 0.1, y: 0.3}, {x: 0.2, y: 0.55}, {x: 0.3, y: 0.72},
        {x: 0.4, y: 0.81}, {x: 0.5, y: 0.87}, {x: 0.6, y: 0.91}, {x: 0.7, y: 0.94},
        {x: 0.8, y: 0.96}, {x: 0.9, y: 0.98}, {x: 1.0, y: 1.0}
      ],
      borderColor: '#10b981',
      backgroundColor: 'rgba(16, 185, 129, 0.1)',
      pointRadius: 3,
      tension: 0.4,
      fill: true
    }, {
      label: 'Random Classifier',
      data: [{x: 0, y: 0}, {x: 1, y: 1}],
      borderColor: '#6b7280',
      borderDash: [5, 5],
      pointRadius: 0
    }]
  };

  const featureImportanceData = {
    labels: ['Baseline Volume', 'CHC Affiliation', 'Rural Setting', 'Medicaid Expansion', 'Years Experience', 'Provider Type'],
    datasets: [{
      label: 'Feature Importance',
      data: [0.34, 0.22, 0.18, 0.14, 0.08, 0.04],
      backgroundColor: ['#1e40af', '#059669', '#dc2626', '#f59e0b', '#8b5cf6', '#6b7280'],
      borderWidth: 0,
    }]
  };

  const regularizationPathData = {
    labels: Array.from({length: 20}, (_, i) => (i * 0.05).toFixed(2)),
    datasets: [
      {
        label: 'Baseline Volume',
        data: [2.34, 2.33, 2.31, 2.28, 2.24, 2.19, 2.13, 2.06, 1.98, 1.88, 1.77, 1.64, 1.49, 1.32, 1.13, 0.92, 0.68, 0.41, 0.12, 0],
        borderColor: '#1e40af',
        backgroundColor: 'transparent',
        tension: 0.4
      },
      {
        label: 'CHC Affiliation',
        data: [1.89, 1.88, 1.86, 1.83, 1.79, 1.74, 1.68, 1.61, 1.53, 1.43, 1.32, 1.19, 1.04, 0.87, 0.68, 0.46, 0.22, 0, 0, 0],
        borderColor: '#059669',
        backgroundColor: 'transparent',
        tension: 0.4
      },
      {
        label: 'Rural Setting',
        data: [0.67, 0.66, 0.64, 0.61, 0.57, 0.52, 0.46, 0.39, 0.31, 0.22, 0.11, 0, 0, 0, 0, 0, 0, 0, 0, 0],
        borderColor: '#dc2626',
        backgroundColor: 'transparent',
        tension: 0.4
      }
    ]
  };

  const renderElasticNetResults = () => (
    <div>
      <ResultsTable>
        <TableTitle>Elastic Net Regularized Logistic Regression - Variable Selection</TableTitle>
        <TableRow>
          <span>Predictor Variable</span>
          <span>Odds Ratio</span>
          <span>Std. Error</span>
          <span>95% CI</span>
          <span>Retained</span>
        </TableRow>
        {elasticNetResults.map((result, index) => (
          <TableRow key={index}>
            <Variable>{result.variable}</Variable>
            <Coefficient significant={result.significant} value={parseFloat(result.coefficient)}>
              {result.coefficient}
            </Coefficient>
            <span>{result.se}</span>
            <span>{result.ci}</span>
            <span style={{ 
              color: result.retained ? '#059669' : '#dc2626',
              fontWeight: '600'
            }}>
              {result.retained ? '✓ Yes' : '✗ No'}
            </span>
          </TableRow>
        ))}
      </ResultsTable>

      <ModelExplanation type="info">
        <ExplanationTitle>Elastic Net Regularization Insights</ExplanationTitle>
        <ExplanationText>
          Elastic net regularization (α=0.5, λ optimized via CV) retained 5 of 6 primary predictors, 
          dropping only provider type due to multicollinearity with practice setting variables. 
          The L1 penalty achieved automatic variable selection while the L2 penalty handled 
          correlated predictors gracefully. Cross-validated λ = 0.023 provided optimal 
          bias-variance tradeoff.
        </ExplanationText>
      </ModelExplanation>
    </div>
  );

  const renderModelValidation = () => (
    <div>
